INSERT INTO `t_operate_log` VALUES (4833, 1, 1, '管理员', 'OA办公-通知公告', '【管理】通知公告-更新 @author 卓大', '/oa/notice/update', 'net.lab1024.sa.admin.module.business.oa.notice.controller.NoticeController.update', '[{\"allVisibleFlag\":true,\"attachment\":\"\",\"author\":\"卓大\",\"contentHtml\":\"<p style=\\\"text-align: justify;\\\">国庆假期即将来临，根据国务院办公厅关于国庆节的放假安排，废纸信息网安排如下：<strong>10月1日至7日放假调休</strong>，共7天。</p><p style=\\\"text-align: justify;\\\"><strong>衷心预祝</strong></p><p style=\\\"text-align: justify;\\\"><strong>国庆快乐，阖家幸福！</strong></p>\",\"contentText\":\"国庆假期即将来临，根据国务院办公厅关于国庆节的放假安排，废纸信息网安排如下：10月1日至7日放假调休，共7天。\\n衷心预祝\\n国庆快乐，阖家幸福！\",\"documentNumber\":\"1024创新实验室发〔2022〕字第36号\",\"noticeId\":60,\"noticeTypeId\":2,\"publishTime\":1704111743000,\"scheduledPublishFlag\":false,\"source\":\"人力行政部\",\"title\":\"1024创新实验室 春节放假通知\",\"visibleRangeList\":[]}]', '127.0.0.1', '0|0|0|内网IP|内网IP', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/134.0.0.0 Safari/537.36 Edg/134.0.0.0', 1, NULL, '2025-04-05 23:20:03', '2025-04-05 23:20:03');
