INSERT INTO `t_operate_log` VALUES (5523, 1, 1, '管理员', 'OA办公-通知公告', '【管理】通知公告-更新 @author 卓大', '/oa/notice/update', 'net.lab1024.sa.admin.module.business.oa.notice.controller.NoticeController.update', '[{\"allVisibleFlag\":true,\"attachment\":\"\",\"author\":\"lovefawn\",\"contentHtml\":\"<p> &nbsp;<strong>SmartFlow</strong> 基于SmartAdmin和Dromara Warm-Flow工作流开源项目，实现了流程设计、流程实例、流程审批、流程监控等功能。</p><h3 style=\\\"text-align: start; line-height: 1;\\\"><strong>技术体系</strong></h3><ul><li style=\\\"text-align: start;\\\">前端：JavaScript + Vue3 + Vite5 + Pinia + Ant Design Vue 4.X</li><li style=\\\"text-align: start;\\\">移动端：uniapp (vue3版本) + uni-ui + （同时支持APP、小程序、H5）</li><li style=\\\"text-align: start;\\\">后端：Java17 + SpringBoot3 + Sa Token + Mybatis-plus + 多种数据库</li></ul><h3 style=\\\"text-align: start; line-height: 1;\\\"><strong>感谢项目</strong></h3><ul><li style=\\\"text-align: start;\\\"><strong>SmartAdmin(https://smartadmin.vip/)</strong> 基于SpringBoot2/3+Sa-Token+Mybatis-Plus 和 Vue3+Ant Design Vue+Uni-App+Uni-UI，并以 <span style=\\\"color: rgb(220, 20, 60);\\\"><strong>「高质量代码」为核心，「简洁、高效、安全」</strong></span>的快速开发平台。</li><li style=\\\"text-align: start;\\\"><strong>Dromara Warm-Flow(https://warm-flow.dromara.org/)</strong> 是一款国产开源工作流引擎，以​​轻量简洁​​（仅7张核心表）和​​高扩展性​​为核心优势，支持通过JAR包快速集成流程设计器，提供​​全场景审批功能​​（包括会签、转办、委派等20+操作）和​​动态规则引擎​​（如条件表达式、办理人变量表达式），内置​​可视化流程图​​（支持节点颜色/文字自定义）并兼容多ORM框架及数据库。</li></ul>\",\"contentText\":\"  SmartFlow 基于SmartAdmin和Dromara Warm-Flow工作流开源项目，实现了流程设计、流程实例、流程审批、流程监控等功能。\\n技术体系\\n前端：JavaScript + Vue3 + Vite5 + Pinia + Ant Design Vue 4.X\\n移动端：uniapp (vue3版本) + uni-ui + （同时支持APP、小程序、H5）\\n后端：Java17 + SpringBoot3 + Sa Token + Mybatis-plus + 多种数据库\\n感谢项目\\nSmartAdmin(https://smartadmin.vip/) 基于SpringBoot2/3+Sa-Token+Mybatis-Plus 和 Vue3+Ant Design Vue+Uni-App+Uni-UI，并以 「高质量代码」为核心，「简洁、高效、安全」的快速开发平台。\\nDromara Warm-Flow(https://warm-flow.dromara.org/) 是一款国产开源工作流引擎，以​​轻量简洁​​（仅7张核心表）和​​高扩展性​​为核心优势，支持通过JAR包快速集成流程设计器，提供​​全场景审批功能​​（包括会签、转办、委派等20+操作）和​​动态规则引擎​​（如条件表达式、办理人变量表达式），内置​​可视化流程图​​（支持节点颜色/文字自定义）并兼容多ORM框架及数据库。\",\"documentNumber\":\"AIHK【2025】1号\",\"noticeId\":73,\"noticeTypeId\":2,\"publishTime\":1744376350000,\"scheduledPublishFlag\":false,\"source\":\"AIHK\",\"title\":\"SmartFlow第一个版本发布上线\",\"visibleRangeList\":[]}]', '127.0.0.1', '0|0|0|内网IP|内网IP', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/135.0.0.0 Safari/537.36 Edg/135.0.0.0', 1, NULL, '2025-04-11 21:00:57', '2025-04-11 21:00:57');
